export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: "comName",
    Cell: (props) => {
      return <td com={props.com}>{props.cell.value}</td>;
    },
  },
  {
    Header: "Scientific Name",
    accessor: "sciName",
    Cell: (props) => {
      return <td onClick={e=>console.log(props.cell.row.original.speciescode)} sci={props.sci}>{props.cell.value}</td>;
    },
  },
  {
    Header: "Location",
    accessor: "locName",
  },
  {
    Header: "Date",
    accessor: "obsDt",
  },
];
